import React, { Component } from 'react';
import './App.css';

class App extends Component {
	render() {
		return (
			<div className="App">
			<Grid />
			</div>
			);
	}
}

const size = 20;
var listItems;

class Grid extends Component {
	render() {
		return (
			<table style={{margin:'100px'}}>
			{this.createTable()}
			</table>
			);
	}



	createTable = () => {
		let table = [];

		for (let i = 0; i < size; i++) {
			let children = [];

			for (let j = 0; j < size; j++) {
				let color = "rgb(" + Math.floor(i / size * 255) + ", " + Math.floor(j / size * 255) + ", 0)";
				children.push(<td><button style={{backgroundColor:{color}}}>{i + j}</button></td>);
			}

			table.push(<tr>{children}</tr>)
		}

		return table;
	};
}

export default App;
